%[text] ## Linear Programming Enumeration
%[text] Problem Description: Find the optimal solution for the following linear programming problem:
%[text] max $z = c^T x$ 
%[text] subject to $Ax=b$, $x\\ge 0${"editStyle":"visual"}
%[text] where the parameters are defined as:
%[text] $c = \[10, 40, 0, 0, 0\]^T, \\quad b = \[480, 480, 480\]^T$
%[text] $A = \\left\[ \\begin{array}{ccccc} 40 & 24 & 1 & 0 & 0 \\\\ 14 & 48 & 0 & 1 & 0 \\\\ 0 & 60 & 0 & 0 & 1 \\end{array} \\right\]$
%% Linear Programming Enumeration Method Test
% Define constraint matrix A, vector b, c
A = [40, 24, 1, 0, 0;
     14, 48, 0, 1, 0;
     0,  60, 0, 0, 1];

b = [480; 480; 480];

c = [10; 40; 0; 0; 0];

% Call the enumeration method function
[x_optimal, z_optimal] = myenumeration(A, b, c);

% Display the results
fprintf('Optimal solution (x_opt):\n'); %[output:5465e521]
disp(x_optimal); %[output:6b661c8c]
fprintf('Optimal objective function value (z_opt): %f\n', z_optimal); %[output:5123ca87]

%% Visualization of Results (For decision variables x1 and x2)
% Since this is a 2D problem (plus 3 slack variables), we can plot the feasible region
fplot(@(x) (480 - 40*x)/24, [0 15], 'r', 'DisplayName', 'Constraint 1'); hold on; %[output:80273c6c]
fplot(@(x) (480 - 14*x)/48, [0 15], 'g', 'DisplayName', 'Constraint 2'); %[output:80273c6c]
yline(8, 'b', 'DisplayName', 'Constraint 3'); % 60*x2 = 480 => x2 = 8 %[output:80273c6c]

% Mark the optimal solution point
if ~isempty(x_optimal)
    plot(x_optimal(1), x_optimal(2), 'kp', 'MarkerFaceColor', 'y', 'MarkerSize', 15, 'DisplayName', 'Optimal Point'); %[output:80273c6c]
end

grid on;  %[output:80273c6c]
xlabel('x1');  %[output:80273c6c]
ylabel('x2'); %[output:80273c6c]
title('Feasible Region and Optimal Solution'); %[output:80273c6c]
legend; %[output:80273c6c]
hold off; %[output:80273c6c]

%%
function [x_opt, z_opt] = myenumeration(A, b, c)
    [m, n] = size(A);

    % Initialize the optimal solution and the optimal objective value
    x_opt = [];
    z_opt = -inf;

    % Generate all possible combinations of m indices (candidate bases)
    % m-element subsets B(k,:) ^= B_k
    all_bases = nchoosek(1:n, m);

    % Iterate over each potential basis
    for k = 1:size(all_bases, 1)
        % Get the indices for the current basis
        basis_indices = all_bases(k, :);

        % Extract the columns from A to form the basis matrix B
        B = A(:, basis_indices);

        % Check if the basis matrix is non-singular (i.e., rank is m)
        if rank(B) == m
            % Solve for the basic variables: B * x_B = b
            x_B = B \ b;

            % Construct the full n-dimensional solution vector x
            x = zeros(n, 1);
            x(basis_indices) = x_B;

            % Check if the solution is feasible (all components >= 0)
            % Using a small tolerance (1e-10) to handle floating-point errors
            if all(x >= -1e-10)
                % Calculate the objective function value for this feasible solution
                z = c' * x;

                % Update the optimal solution if the current z is better
                if z > z_opt
                    z_opt = z;
                    x_opt = x;
                end
            end
        end
    end

    % Check if any feasible solution was found
    if z_opt == -inf
        x_opt = [];
        z_opt = -inf;
        disp('No feasible basic solution found.');
    end
end

